import "./landing.css";
import React from "react";
import NavBar from  "../navbar/navbar.js";
import Footer from "../footer/footer.js";
import Typography from "@mui/material/Typography";
import {changeVisibility} from "../personal_util/display.ts";
import SchoolIcon from "@mui/icons-material/School";
import FeedIcon from "@mui/icons-material/Feed";
import ScienceIcon from "@mui/icons-material/Science";
import GestureIcon from "@mui/icons-material/Gesture";
import FlightTakeoffIcon from "@mui/icons-material/FlightTakeoff";
import WorkIcon from '@mui/icons-material/Work';
import EmailIcon from "@mui/icons-material/Email";
import Button from "@mui/material/Button";
import Stack from '@mui/material/Stack';
import Link from '@mui/material/Link';

function Landing() {
  return (
    <>
      <div id="root" className="width-100 flex column align-center">
        <NavBar />
        <div className="flex justify-between align-center black width-100">
          <div>
            <h1>HELLO</h1>
            <h2>I am Ahmed</h2>
            <h3>Welcome to my slice of the web!</h3>
          </div>
          <div className="circle sqr-200px green">
            <div className="circle">
              <div className="circle profile-image"></div>
            </div>
          </div>
        </div>

        {/** Projects/Research **/}


        {/** Papers / Publications **/}


        {/** Education / Work **/}

        {/** Art **/}


        {/** Group Three: Travel **/}


        {/** Group Four: Contact **/}

        <Footer />
      </div>
    </>
  );
}

export default Landing;
